import { PRODUCTS } from "../../products";
import { Product } from "./product";
import "./shop.css";

export const Shop = () => {

  return (
    <div className="shop">
      <div className="shopTitle">
        <h1>Хоолны цэс</h1>
        <div>
          </div>
    
      </div>
  


      
     <div className="products">
        {PRODUCTS.map((product) => (
          <Product data={product} />
        ))}
      </div>
    </div>
  );
};
